exports.command=function(phone_Number_1, painAtRest_1, painInMotion_1, nightlyPain_1, sleepingCausedByPain_1, incapabilityOfLyingOnPainfulSide_1, degreeOfRadiation_1,
                   phone_Number,painAtRest,painInMotion,nightlyPain,sleepingCausedByPain,incapabilityOfLyingOnPainfulSide,degreeOfRadiation){
	this
	.getValue('#number_id' , function(result){
		phone_Number_1.push(result.value)
	})
	for(i=1; i<=4; i++){
      var a1=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   painAtRest_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="painAtRest"][value="'+i+'"]' , 'checked' , a1)
      }
//---------------------------------------------------------------------------------------------   
for(i=1; i<=4; i++){
      var a2=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   painInMotion_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="painInMotion"][value="'+i+'"]' , 'checked' , a2)
      }
//--------------------------------------------------------------------------------------------- 
for(i=1; i<=4; i++){
      var a3=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   nightlyPain_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="nightlyPain"][value="'+i+'"]' , 'checked' , a3)
      }
//---------------------------------------------------------------------------------------------  
for(i=1; i<=4; i++){
      var a4=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   sleepingCausedByPain_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="sleepingCausedByPain"][value="'+i+'"]' , 'checked' , a4)
      }
//--------------------------------------------------------------------------------------------- 
for(i=1; i<=4; i++){
      var a5=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   incapabilityOfLyingOnPainfulSide_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="incapabilityOfLyingOnPainfulSide"][value="'+i+'"]' , 'checked' , a5)
      }
//--------------------------------------------------------------------------------------------- 
for(i=1; i<=4; i++){
      var a6=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   degreeOfRadiation_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="degreeOfRadiation"][value="'+i+'"]' , 'checked' , a6)
      }
//--------------------------------------------------------------------------------------------- 
this
  .verify.visible('input[id="acceptstatement_id"][checked="checked"]')
  .verify.valueContains('#number_id' , phone_Number)
  .verify.elementPresent('input[name="painAtRest"][value="'+painAtRest+'"][checked="checked"]')
  .verify.elementPresent('input[name="painInMotion"][value="'+painInMotion+'"][checked="checked"]')
  .verify.elementPresent('input[name="nightlyPain"][value="'+nightlyPain+'"][checked="checked"]')
  .verify.elementPresent('input[name="sleepingCausedByPain"][value="'+sleepingCausedByPain+'"][checked="checked"]')
  .verify.elementPresent('input[name="incapabilityOfLyingOnPainfulSide"][value="'+incapabilityOfLyingOnPainfulSide+'"][checked="checked"]')
  .verify.elementPresent('input[name="degreeOfRadiation"][value="'+degreeOfRadiation+'"][checked="checked"]')

   return this
}